  false,\n\t\"url\": null,\n\t\"notes\": \" n        To guide the analysis, a research
  framework composed of the following five research questions was used: (1) How was
  the PBS Activity designed and why was it designed this way? (2) How was the activity
  implemented? (3) Did the activity produce its desired results, and what is the extent
  of the relevant evidence? (4) What was learned about supporting enterprise development
  and how sustainable are MCCu2019s efforts in this area? and (5) What are the lessons
  for MCC and other stakeholders from the design and implementation of this activity?nThis
  analysis relies on a mixed-methods approach, in which Mathematica staff collected
  and analyzed qualitative and quantitative data from a variety of sources, including
  administrative records, programmatic reports, and stakeholder interviews. In July
  2012, Mathematica staff conducted interviews with MCC, FOMILENIO, Chemonics, and
  technical service provider staff, as well as members of FOMILENIOu2019s board of
  directors, an official from the Ministry of Agriculture, representatives from Su00faper
  Selectos (a major grocery store chain in El Salvador), PBS participants, and representatives
  from FOMILENIO-supported enterprises. To formulate primary findings and conclusions,
  Mathematica staff triangulated qualitative information provided by all interviewed
  stakeholders and analyzed this information in conjunction with administrative reports
  and records.n      \",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
